// üî¥üî¥üî¥ ÿ®ÿØÿßŸäÿ© ÿßŸÑÿ™ÿπÿØŸäŸÑ: ÿØÿßŸÑÿ© ÿßŸÑŸÅŸÑÿ™ÿ±ÿ© ÿßŸÑÿ∞ŸÉŸäÿ© üî¥üî¥üî¥
/**
 * ÿØÿßŸÑÿ© ŸÅŸÑÿ™ÿ±ÿ© ÿ∞ŸÉŸäÿ© ŸàŸÖÿ≠ÿ≥ŸÜÿ©
 */
function filterChannel(channel: IPTVChannel, category: string | null): boolean {
  // (1) ÿßŸÑÿ™ÿπÿßŸÖŸÑ ŸÖÿπ ÿßŸÑÿ≠ÿßŸÑÿßÿ™ ÿßŸÑÿπÿßŸÖÿ©
  if (!category || category === "all-channels" || category === "about" || category.startsWith("faq") || category.startsWith("privacy") || category.startsWith("feedback")) {
    return true
  }
  if (category === "random-channel") {
    return true
  }

  // (2) ÿ™ŸÜÿ∏ŸäŸÅ ÿßÿ≥ŸÖ ÿßŸÑŸÅÿ¶ÿ© ÿßŸÑŸÖÿ∑ŸÑŸàÿ®ÿ© (ŸÖÿ´ŸÑ "top-news" ÿ™ÿµÿ®ÿ≠ "top news")
  const requestedCategory = category.toLowerCase().replace("-", " ");
  
  // (3) ÿßŸÑÿ≠ÿµŸàŸÑ ÿπŸÑŸâ ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑŸÇŸÜÿßÿ© Ÿàÿ™ÿ¨ŸáŸäÿ≤Ÿáÿß ŸÑŸÑÿ®ÿ≠ÿ´
  const chName = channel.name.toLowerCase();
  const chCategory = channel.category?.toLowerCase(); // (Ÿáÿ∞ÿß ŸÑŸÑÿ™ÿµŸÜŸäŸÅ ÿßŸÑŸäÿØŸàŸä)

  // (4) ‚≠êÔ∏è‚≠êÔ∏è‚≠êÔ∏è ÿßŸÑŸÅŸÑÿ™ÿ±ÿ© ÿßŸÑÿ∞ŸÉŸäÿ© ‚≠êÔ∏è‚≠êÔ∏è‚≠êÔ∏è

  // --- ÿßŸÑÿÆÿ∑Ÿàÿ© ÿ£: ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿßŸÑÿ™ÿµŸÜŸäŸÅ ÿßŸÑŸäÿØŸàŸä (ÿ•ÿ∞ÿß ŸÉŸÜÿ™ ŸÇÿØ ÿπÿØŸÑÿ™ ÿ®ÿπÿ∂Ÿáÿß ŸäÿØŸàŸäÿßŸã)
  // Ÿáÿ∞ÿß ŸáŸà ÿ£ÿ≥ÿ±ÿπ Ÿàÿ£ÿØŸÇ ÿ≠ŸÑ
  if (chCategory === requestedCategory) {
    return true;
  }
  // (ÿ≠ÿßŸÑÿ© ÿÆÿßÿµÿ© ŸÑŸÄ top-news Ÿà news)
  if (chCategory === 'news' && (requestedCategory === 'top news' || requestedCategory === 'news')) {
    return true;
  }

  // --- ÿßŸÑÿÆÿ∑Ÿàÿ© ÿ®: ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿßŸÑŸÉŸÑŸÖÿßÿ™ ÿßŸÑŸÖŸÅÿ™ÿßÿ≠Ÿäÿ© (ÿßŸÑÿ≠ŸÑ "ÿßŸÑÿ∞ŸÉŸä" ÿßŸÑÿ∞Ÿä ÿ∑ŸÑÿ®ÿ™Ÿá)
  // 1. ÿ™ÿ≠ÿØŸäÿØ ŸÇÿßÿ¶ŸÖÿ© ÿßŸÑŸÉŸÑŸÖÿßÿ™ ÿßŸÑÿµÿ≠Ÿäÿ≠ÿ©. (ŸÖÿ´ÿßŸÑ: "top-news" Ÿà "news" ŸÉŸÑÿßŸáŸÖÿß Ÿäÿ≥ÿ™ÿÆÿØŸÖ "news")
  let keywords: string[] | undefined = categoryKeywords[requestedCategory];
  if (requestedCategory === 'top news') {
    keywords = categoryKeywords['news'];
  }
  
  // 2. ÿßŸÑÿ®ÿ≠ÿ´ ÿ•ÿ∞ÿß ŸÉÿßŸÜ ÿßÿ≥ŸÖ ÿßŸÑŸÇŸÜÿßÿ© Ÿäÿ≠ÿ™ŸàŸä ÿπŸÑŸâ ÿ£Ÿä ŸÖŸÜ ÿßŸÑŸÉŸÑŸÖÿßÿ™ ÿßŸÑŸÖŸÅÿ™ÿßÿ≠Ÿäÿ©
  if (keywords) {
    if (keywords.some(keyword => chName.includes(keyword))) {
      return true;
    }
  } else {
    // (ŸÉÿ≠ŸÑ ÿßÿ≠ÿ™Ÿäÿßÿ∑Ÿä ÿ•ÿ∞ÿß ŸÑŸÖ ÿ™ŸÉŸÜ ÿßŸÑŸÅÿ¶ÿ© ŸÖŸàÿ¨ŸàÿØÿ© ŸÅŸä ŸÇÿßŸÖŸàÿ≥ŸÜÿß)
    // Ÿáÿ∞ÿß ŸáŸà ÿßŸÑŸÉŸàÿØ ÿßŸÑŸÇÿØŸäŸÖ ÿßŸÑÿÆÿßÿµ ÿ®ŸÉ
    if (chName.includes(requestedCategory)) {
      return true;
    }
  }

  // (5) ÿ•ÿ∞ÿß ŸÑŸÖ Ÿäÿ™ÿ∑ÿßÿ®ŸÇ ÿ£Ÿä ÿ¥Ÿäÿ°
  return false
}
// üî¥üî¥üî¥ ŸÜŸáÿßŸäÿ© ÿßŸÑÿ™ÿπÿØŸäŸÑ üî¥üî¥üî¥


/**
 * üî¥ ÿ™ÿπÿØŸäŸÑ: ÿßŸÑÿØÿßŸÑÿ© ÿßŸÑÿ¢ŸÜ ÿ™ŸÅŸÑÿ™ÿ± ÿ≠ÿ≥ÿ® ÿßŸÑÿØŸàŸÑÿ© ŸàÿßŸÑŸÅÿ¶ÿ©
 */
export async function getChannelsByCountry(
  country: string,
  category: string | null // üëà (1) ÿßÿ≥ÿ™ŸÇÿ®ÿßŸÑ ÿßŸÑŸÅÿ¶ÿ©
): Promise<IPTVChannel[]> {
  
  await new Promise((resolve) => setTimeout(resolve, 300))
  
  const allChannels = channelsByCountry[country] || []
  
  const normalizedChannels = allChannels.map((ch) => ({
    ...ch,
    url: normalizeYouTubeUrl(ch.url),
  }))

  // üëà (2) ÿßÿ≥ÿ™ÿÆÿØÿßŸÖ ÿØÿßŸÑÿ© ÿßŸÑŸÅŸÑÿ™ÿ±ÿ© ÿßŸÑÿ∞ŸÉŸäÿ©
  const filtered = normalizedChannels.filter(ch => filterChannel(ch, category))

  // üëà (3) ŸÖÿπÿßŸÑÿ¨ÿ© ÿßŸÑÿ≠ÿßŸÑÿ© ÿßŸÑÿπÿ¥Ÿàÿßÿ¶Ÿäÿ©
  if (category === "random-channel") {
    return filtered.sort(() => 0.5 - Math.random()).slice(0, 20)
  }

  return filtered
}

/**
 * üî¥üî¥üî¥ ÿ®ÿØÿßŸäÿ© ÿßŸÑÿ•ÿ∂ÿßŸÅÿ©: ÿØÿßŸÑÿ© ÿ¨ÿØŸäÿØÿ© ŸÑŸÑÿ®ÿ≠ÿ´ ÿßŸÑÿπÿßŸÖ (ÿßŸÑÿ™Ÿä ÿ∑ŸÑÿ®Ÿáÿß) üî¥üî¥üî¥
 * Fetches all channels from ALL countries that match a category
 */
export async function getChannelsByCategory(
  category: string | null
): Promise<IPTVChannel[]> {

  await new Promise((resolve) => setTimeout(resolve, 300))

  // 1. ŸÑÿß ÿ™ŸÇŸÖ ÿ®ÿ£Ÿä ÿ¥Ÿäÿ° ÿ•ÿ∞ÿß ŸÉÿßŸÜÿ™ ÿßŸÑŸÅÿ¶ÿ© ÿπÿßŸÖÿ© (ÿ≥ÿ™ÿπÿ±ÿ∂ ŸÇÿßÿ¶ŸÖÿ© ÿßŸÑÿØŸàŸÑ ÿ®ÿØŸÑÿßŸã ŸÖŸÜ ÿ∞ŸÑŸÉ)
  if (!category || category === "all-channels" || category === "about" || category.startsWith("faq") || category.startsWith("privacy") || category.startsWith("feedback")) {
    return []
  }

  // 2. ÿ™ÿ¨ŸÖŸäÿπ ŸÉŸÑ ÿßŸÑŸÇŸÜŸàÿßÿ™ ŸÖŸÜ ŸÉŸÑ ÿßŸÑÿØŸàŸÑ
  let allChannels: IPTVChannel[] = []
  for (const country in channelsByCountry) {
    channelsByCountry[country].forEach(channel => {
      allChannels.push({
        ...channel,
        countryName: country, // üëà (ÿ•ÿ∂ÿßŸÅÿ© ÿßÿ≥ŸÖ ÿßŸÑÿØŸàŸÑÿ© ŸÑŸÑŸÇŸÜÿßÿ©)
      })
    })
  }
  
  const normalizedChannels = allChannels.map((ch) => ({
    ...ch,
    url: normalizeYouTubeUrl(ch.url),
  }))

  // 3. ÿßÿ≥ÿ™ÿÆÿØÿßŸÖ ŸÜŸÅÿ≥ ÿØÿßŸÑÿ© ÿßŸÑŸÅŸÑÿ™ÿ±ÿ© ÿßŸÑÿ∞ŸÉŸäÿ©
  const filtered = normalizedChannels.filter(ch => filterChannel(ch, category))

  // 4. ŸÖÿπÿßŸÑÿ¨ÿ© ÿßŸÑÿ≠ÿßŸÑÿ© ÿßŸÑÿπÿ¥Ÿàÿßÿ¶Ÿäÿ© (ÿ®ÿ¥ŸÉŸÑ ÿπÿßŸÖ)
  if (category === "random-channel") {
    return filtered.sort(() => 0.5 - Math.random()).slice(0, 40) // (ŸÜÿπÿ±ÿ∂ 40 ŸÇŸÜÿßÿ© ÿπÿ¥Ÿàÿßÿ¶Ÿäÿ©)
  }

  return filtered
}
